import axios from "axios";
import React, { Component } from "react";

export default class EditNotes extends Component {
  componentDidMount() {
    axios
      .get("http://localhost:5000/notes/allNotes")
      .then((response) => {
        this.setState({ notes: response.data });
      })
      .catch((error) => {
        console.log(error);
      });
  }
  render() {
    return <div>{}</div>;
  }
}
